  false,\n\t\"url\": null,\n\t\"notes\": \"The Digital Flood Insurance Rate Map (DFIRM)
  Database depicts flood risk information and supporting data used to develop the
  risk data. The primary risk classifications used are the 1-percent-annual-chance
  flood event,the 0.2-percent-annual-chance flood event, Floodway, and areas of minimal
  flood risk. The DFIRM Database is derived from the JONES County Flood Insurance
  Study (FIS), the City of Espanola FIS, and the Village of Chama FIS flood hazard
  analyses performed in support of the Flood Insurance Studies and FIRMs, and new
  mapping data, where available. The Flood Insurance Studies and FIRMs are published
  by the Federal Emergency Management Agency (FEMA). The file is georeferenced to
  earth's surface using the Universal Transverse Mercator projection Zone 13 coordinate
  system referenced to the North American Datum of 1983. The specifications for the
  horizontal control of Base Map data files are consistent with those required for
  mapping at a scale of 1:6,000 and 1:12,000.\",\n\t\"license_title\": null,\n\t\"extras\":
